description:
- Lorde in Wonderland with us again -


~ She wraps her charms and arms full of art all around us, to disarm and embrace us, to brace and then race us to the sun and moon ~


* Another stunning outdoor sunset set, with all that that entails, the varied shades of colors aglow to unveil in our Lorde that she never fails to prevail to show and shine on us all *


Lorde
We Love Green 2014
Parc de Bagatelle
Paris, France
June 1, 2014

